            <li><a href="#"><i class="fa fa-instagram" aria-hidden="true"></i></a></li>
            </ul>
        </div>
        <div className="row" style={{display:"flex"}}>
        <a href="https://instagram.com/tanishq.jpeg?igshid=v641smjwre38" class="fa fa-instagram" ></a>
          <a href="https://vsco.co/tanishqsandhu/images" class="fa fa-camera" data-wow-delay="0.6s"></a>
